import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question({getquestionid, question}) {

    const q = getquestionid(question.id);
    console.log(q);

    return(
        <Paper>
            <h1>Question Details</h1>
        </Paper>
    )
}

export default Question;
